function ListItem(props){

    return( 
        <li className= "list-group-item">
            <img src={props.img} alt=''/>
           <input type="checkbox" id={props.id}/>
           <label htmlFor={props.id}>{props.type}</label>
        </li>

    )

}

export default ListItem
